import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import {add,minus,mult,div} from "./Calc"
import App from "./App";
ReactDOM.render(<>
<h1>the sum is {add(2,3)} </h1>
<h1>the minus is {minus(2,3)} </h1>
<h1>the mult is {mult(2,3)} </h1>
<h1>the div is {div(2,3)} </h1>
</>
    , document.getElementById("root"));
